import React from 'react';

function App() {

  const fetchAndLog = async () => {
    const response = await fetch('http://localhost:5000/stock/value?function=CURRENCY_EXCHANGE_RATE&from_currency=BTC&to_currency=INR');
    console.log({ ...response });
    const json = await response.json();

    console.log(json);
  };

  return (
    <div className="App">


       Crypto Values

          Crypto Code:
          <input name="crypto_name"></input>


          Currency: <input name="currency"></input><br />


          <button onClick={fetchAndLog}>Submit</button>
          <input type="button" value="Cancel" name="Cancel"></input>



    </div>
  );
}

export default App;
